import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useState } from 'react';
import Register from './auth/Register';
import Login from './auth/Login';
import {BrowserRoutesr, Routess, Routesr} from "react-Routesr-dom";
import Adminlogin from './auth/Adminlogin';
import Adminregistration from './Components/Adminregistration';
import Superadmin from './auth/Superadmin';
import Dashboard from './Dashboard';
import Newgrievance from './Newgrievance';
import Admin from './Admin';
import Adminmaster from './Adminmaster';
import View from './View';
import Complaint from './Components/Complaint';
import Home from './Home';
import Dashboardsuperadmin from './Dashboardsuperadmin';
import Manageusers from './Manageusers';

function App() {
  const[image,setimage]=useState(null);
  const handle=(name)=>{
    setimage(name);
    console.log(name);
  }
  return (
    <>

      <Router>

      <Routes path='/' element={<Home/>}/>
      <Routes path='/history' element={<Dashboard/>}/>
      <Routes path='/new' element={<Newgrievance/>}/>
      <Routes path='/complaint' element={<Complaint handle_view={handle}/>}/>
      <Routes path='/create-admin' element={<Adminregistration/>} />
      <Routes path='/admin' element={<Admin handle_view={handle}/>}/>
      <Routes path='/superadmin' element={<Adminmaster handle_view={handle}/>}/>
      <Routes path='/dashboards-a' element={<Dashboardsuperadmin/>}/>
      <Routes path='/manage-users' element={<Manageusers/>}/>
      <Routes path='/superadminlogin' element={<Superadmin/>}/>
      <Routes path='/adminlogin' element={<Adminlogin/>}/>
      <Routes path="/register" element={<Register/>}/>
      <Routes path="/login" element={<Login/>}/>  
      <Routes path="/image" element={<View image={image}/>} />

      </Router>
    </>
  );
}

export default App;
